import { sesClient } from "@/lib/sesClient";
import { UpdateTemplateCommand } from "@aws-sdk/client-ses";

export const UpdateEmailTemplate = async () => {
    const command = new UpdateTemplateCommand({
        Template: {
          TemplateName: "ArticleBroadcast",
          SubjectPart: "{{title}}",
          HtmlPart: `
            <!DOCTYPE html>
            <html>
              <body style="margin:0; padding:0; font-family: Arial, sans-serif;">
                <div style="max-width: 600px; margin: 0 auto; padding: 20px; width: 100%; background-color: #ffffff;">
                  
                  <div style="display: flex; justify-content: center; margin-bottom: 2rem;">
                    <img src="data:image/png;base64," width="200" />
                  </div>

                  <div style="margin-top: 5rem; margin-bottom: 5rem;">
                    <p style="font-size: 16px;">Hey {{name}},</p>
        
                    <p style="font-size: 16px;">Check out our latest article on <strong>{{title}}</strong></p>
        
                    <p style="font-size: 16px; margin: 3rem 0;">{{description}}</p>
        
                    <a href="http://localhost:3000/{{slug}}" 
                        style="display: inline-block; padding: 10px 20px; background-color: rgb(45, 110, 164); color: white; font-size: 14px; text-decoration: none; border-radius: 14px;">
                        Read Now
                    </a>
                  </div>
    
                  <div style="display: flex; justify-content: center; padding-top: 3rem; padding-bottom: 1rem; gap: 1rem;">
                    <a href="https://www.instagram.com/yalovetsvanya?igsh=MWNrbWtwa2oyODE1eQ%3D%3D">
                      <img src="data:image/png;base64," width="35" />
                    </a>
                    <a href="https://www.facebook.com/yalovechik">
                      <img src="data:image/png;base64," width="35" />
                    </a>
                    <a href="">
                      <img src="data:image/png;base64," width="35" />
                    </a>
                  </div>
                  
                  <div style="display: flex; justify-content: center;">
                    <p style="text-align: center;">Sent to: <a href="mailto:{{email}}">{{email}}</a></p>
                  </div>
    
                  <div style="display: flex; justify-content: center; padding: 6px 0;">
                    <a style="color: black; text-size: 16px;" href="http://localhost:3000/unsubscribe?email={{email}}"><strong>Unsubscribe</strong></a>
                  </div>
    
                  <div style="display: flex; justify-content: center; padding: 3px 0;">
                    <p style="text-align: center;">Yalovets Blog, Kulparkivska 226, Lviv, Ukraine</p>
                  </div>
                </div>
              </body>
            </html>
          `,
          TextPart: `Hi {{name}},\n\nCheck out our latest article on {{title}}...\n\nRead Now: http://localhost:3000/{{slug}}`,
        },
      });

    await sesClient.send(command);
    console.log('updated template');
}